import React from 'react';
import './collection-preview.styles.scss'

const CollectionPreview = ({items, title}) => (
        <div className='collection'>
            <h1 className="title">{title}</h1>
            {
                items.map(item => (
                    <div>{item.name}</div>
                ))
            }
        </div>
);

export default CollectionPreview;
